resource "kubernetes_namespace_v1" "app" {
  for_each = { for env in local.environments : env.name => env }

  metadata {
    name = "${local.k8s_base_namespace}-${each.key}"
    annotations = local.default_tags
  }
}


resource "kubernetes_secret_v1" "jfrog" {
  for_each = { for env in local.environments : env.name => env }

  metadata {
    name      = data.kubernetes_secret_v1.jfrog.metadata[0].name
    namespace = kubernetes_namespace_v1.app[each.key].metadata[0].name
  }

  data     = data.kubernetes_secret_v1.jfrog.data
  type     = data.kubernetes_secret_v1.jfrog.type
}

